query:
INSERT INTO subscriptions (userId, planId, status, startDate, endDate) 
SELECT 1, id, 'active', NOW(), DATE_ADD(NOW(), INTERVAL 1 YEAR) 
FROM plans WHERE name = 'free' LIMIT 1;

